import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const DashboardPage = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    fetch('http://127.0.0.1:5000/logout', {
      method: 'DELETE'
    })
      .then(() => {
        navigate('/');
      })
      .catch((error) => {
        console.error('Error logging out:', error);
      });
  };

  return (
    <div className="flex justify-center items-center min-h-screen">
      <div className="grid grid-cols-2 grid-rows-3 gap-4">
        <Link to="/rentals">
          <button className="bg-blue-500 text-white px-4 py-2 rounded-lg hover:shadow-lg hover">
            View Rentals
          </button>
        </Link>
        <Link to="/bookings">
          <button className="bg-blue-500 text-white px-4 py-2 rounded-lg hover:shadow-lg">
            View Bookings
          </button>
        </Link>
        <Link to="/manage-listings">
          <button className="bg-blue-500 text-white px-4 py-2 rounded-lg hover:shadow-lg">
            Manage Listings
          </button>
        </Link>
        <Link to="/favorites">
          <button className="bg-blue-500 text-white px-4 py-2 rounded-lg hover:shadow-lg">
            View Favorites
          </button>
        </Link>
        <Link to="/account-settings">
          <button className="bg-blue-500 text-white px-4 py-2 rounded-lg hover:shadow-lg">
            Account Settings
          </button>
        </Link>
        <button
          onClick={handleLogout}
          className="bg-red-500 text-white px-4 py-2 rounded-lg hover:shadow-lg"
        >
          Logout
        </button>
      </div>
    </div>
  );
};

export default DashboardPage;
